-- ----------------------------
-- View structure for v_prod_stock
-- ----------------------------
DROP VIEW IF EXISTS `v_prod_stock`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `v_prod_stock` AS select `o`.`COMPANY_ID` AS `COMPANY_ID`,`p`.`ID` AS `PRODUCT_ID`,cast((sum(`o`.`INVENTORY_QUANTITY`) - ifnull((select sum(`r`.`RESERVATION_QUANTITY`) from `inv_reservations` `r` where ((`r`.`PRODUCT_ID` = `o`.`PRODUCT_ID`) and (`r`.`COMPANY_ID` = `o`.`COMPANY_ID`))),0)) as signed) AS `QTY` from (`inv_onhand` `o` join `mtl_product` `p`) where (`o`.`PRODUCT_ID` = `p`.`ID`) group by `o`.`PRODUCT_ID`,`o`.`COMPANY_ID`;

-- ----------------------------
-- View structure for v_prod_wh_stock
-- ----------------------------
DROP VIEW IF EXISTS `v_prod_wh_stock`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `v_prod_wh_stock` AS select `o`.`COMPANY_ID` AS `COMPANY_ID`,`o`.`WAREHOUSE_ID` AS `WAREHOUSE_ID`,`p`.`ID` AS `PRODUCT_ID`,cast((sum(`o`.`INVENTORY_QUANTITY`) - ifnull((select sum(`r`.`RESERVATION_QUANTITY`) from `inv_reservations` `r` where ((`r`.`PRODUCT_ID` = `o`.`PRODUCT_ID`) and (`r`.`COMPANY_ID` = `o`.`COMPANY_ID`) and (`r`.`WAREHOUSE_ID` = `o`.`WAREHOUSE_ID`))),0)) as signed) AS `QTY` from (`inv_onhand` `o` join `mtl_product` `p`) where (`o`.`PRODUCT_ID` = `p`.`ID`) group by `o`.`WAREHOUSE_ID`,`o`.`PRODUCT_ID`,`o`.`COMPANY_ID`;

SET FOREIGN_KEY_CHECKS = 1;
